INSERT INTO `EmailNotificationTemplates` (`id`, `subject`, `body`) VALUES
(1, 'Password restore request', '<p>A new password has been set on your request. Please go to your profile and change it to a password of your choice</p>\r\n<p>Current password:{{new_password}}</p>\r\n'),
(2, 'New Message on UINteam', '<p>You have a new private message on UINteam - please follow the link to view it:\r\n<a href="{{link}}">{{link}}</a></p>'),
(3, 'New Notification on UINteam', '<p>You have a new system notification on UINteam - please follow the link to view it:\r\n<a href="{{link}}">{{link}}</a></p>'),
(4, 'Email verification for UINteam registration ', '<p>Dear {{user}},</p>\r\n\r\n<p>Thank you for registering with uinteam.</p> \r\n\r\n<p>Please verify your email by following the link below to activate your account:</p>\r\n<p><a href="{{link}}">{{link}}</a></p>\r\n\r\n<p>You can now follow the free, friendly and fast selection steps of the website (What, Where, When, Budget), and the uinteam platform will find the service you need, where and when you need it through an automatic matching process with the relevant registered Suppliers. Furthermore, when you are not familiar with the required service, uinteam will assist you with competent Advisers, whose only purpose is to provide you with advices to get the best deal. They might be suppliers, and they might even compete for the deal.</p>\r\n\r\n<p>If you can supply a service, just follow the same selection steps for Supplier, and the uinteam platform will find for you the Askers'' requests matching your requirements. </p>\r\nWhen you accept the request, you might win the competition through the uinteam automatic selection process, and be automatically procured as the best supplier to start delivering your service. At present the selection process is based on the objective factors of experience, qualifications and feedback. However the platform aims to develop a wider complex selection tool for users.</p>\r\n\r\n<p>Registrations are now open to build the strongest Supplier team and start to analyze the pattern of demand for all services. </p>\r\nSo, please, share uinteam with your connections, and, remember, uinteam will never ask you for any fee.</p>\r\n<p>If you like, you can also be an Adviser to assist askers on any deal relevant to your expertise.</p>\r\n<p>When advised deals are successful, Advisers will be rewarded by uinteam with a percentage of the deal''s transaction.</p>\r\n<p>Many thanks</p>\r\n<p>Enjoy uinteam!</p>\r\n<p>uinteam</p>\r\n<img src="{{domain}}/deployment/img/css/logo.png" alt="UinTeam" width="100"/>'),
(5, 'New Asker Request', 'There is a new request from the Asker on the UINteam.\r\nYou can view the request in your <a href="http://uinteam.com/myuin/notifications/">notifications</a>'),
(6, 'Supplier has been found', 'The best Supplier has been selected for you.\r\nYou can now fund the service you were asking for via your <a href="http://uinteam.com/myuin/notifications/">notifications</a>'),
(7, 'New Advice Request', 'There is a new request for an Advice from an Asker on the UINteam.\r\nYou can view the request in your <a href="http://uinteam.com/myuin/notifications/">notifications</a>'),
(8, 'New Advice', 'You have a new advice on the UINteam.\r\nYou can view the advice in your <a href="http://uinteam.com/myuin/notifications/">notifications</a>'),
(9, 'New feedback request', '<p>You have a new feedback request on the UINteam.</p>\r\n<p>You can view it in your <a href="http://uinteam.com/myuin/notifications/">notifications</a></p>\r\n<p>Please note that you want be able to make further queries until you give feedback.</p>\r\n'),
(10, 'You have a new notification on uinteam', '<p>You can view it in your <a href="http://uinteam.com/myuin/notifications/">notifications</a></p>'),
(11, 'The funds have been escrowed', '<p>Read more in your <a href="http://uinteam.com/myuin/notifications/">notifications</a> on uinteam </p>'),
(12, 'Adviser found for your request', '<p>An Adviser has sent you a proposal. You can now accept the advice for the service you were asking for via your notifications</p>'),
(13, 'Thank you for your registration', 'Dear {{user}},\r\n\r\n<p>Thank you for registering with uinteam.</p>\r\n\r\n<p>You can now follow the free, friendly and fast selection steps of the website (What, Where, When, Budget), and the uinteam platform will find the service you need, where and when you need it through an automatic matching process with the relevant registered Suppliers. Furthermore, when you are not familiar with the required service, uinteam will assist you with competent Advisers, whose only purpose is to provide you with advices to get the best deal. They might be suppliers, and they might even compete for the deal.</p>\r\n\r\n<p>If you can supply a service, just follow the same selection steps for Supplier, and the uinteam platform will find for you the Askers'' requests matching your requirements.</p>\r\n\r\n<p>When you accept the request, you might win the competition through the uinteam automatic selection process, and be automatically procured as the best supplier to start delivering your service. At present the selection process is based on the objective factors of experience, qualifications and feedback. However the platform aims to develop a wider and complex selection tool for users.\r\nRegistrations are now open to build the strongest Supplier team and start to analyze the pattern of demand for all services.</p>\r\n\r\n<p>So, please, share uinteam with your connections, and, remember, uinteam will never ask you for any fee.</p>\r\n<p>If you like, you can also be an Adviser to assist askers on any deal relevant to your expertise.</p>\r\n\r\n<p>When advised deals are successful, Advisers will be rewarded by uinteam with a percentage of the deal''s transaction.</p>\r\n\r\n<p>Many thanks</p>\r\n\r\n<p>Enjoy uinteam!</p>\r\n\r\n<p>uinteam</p>\r\n<img src="{{domain}}/deployment/img/css/logo.png" alt="UinTeam" width="100"/>');
