(3, 'Web developer - Startup', '43ec517d68b6edd3015b3edc9a11367b.jpg', '<p><span style="font-family:arial,sans-serif; font-size:10pt">uinteam is a very good idea for any freelance,&nbsp;small business, entrepreneur or startup, like mine as a web developer, to look&nbsp;for new customers that you can then accept or not as you like, depending on your requirements. Then the&nbsp;unbiased selection process based&nbsp;on merit does the rest, assigning to you the job if you are the best to deliver the service.</span></p>\n\n<p><span style="font-family:arial,sans-serif; font-size:10pt">The registration process for suppliers is very fast and user friendly, and mainly worthwhile as the registration is&nbsp;completely free.</span></p>\n\n<p><span style="font-family:arial,sans-serif; font-size:10pt">Startup</span></p>\n', 'freelance,business,entrepreneur,startup, customers,unbiased,selection process,merit,best,deliver,service', '2016-06-22 00:40:27');
