INSERT INTO `TextManager` (`id`, `title`, `text`) VALUES
(1, 'about_ask', '<h2><span style="color:rgb(51, 0, 255)">Do you need a service?</span></h2>\r\n\r\n<p>Everyone does! You can use the many existing online marketplaces and spend the rest of your day or week for your search. You might be notified by many suppliers,&nbsp;and enabled to select your requirements,&nbsp;or endlessly discuss about the service.</p>\r\n\r\n<p>However, if nowadays you have no time to go through such a process, getting frustrated by Suppliers&#39; specifications, notifications, or questions you cannot even understand, just Ask uinteam!</p>\r\n\r\n<p><strong>Follow the free, friendly and fast selection steps of the website (What, Where, When, Budget), and the uinteam platform will instantaneously find the service you need, where and when you&nbsp;need it&nbsp;through an automatic matching process.</strong></p>\r\n\r\n<p>Furthermore, when you are not familiar with the service you need, uinteam will assist you with competent Advisers, whose only purpose is to provide you with advices to get the best deal. They might be Suppliers, and they might even compete for the deal.</p>\r\n'),
(2, 'about_supply', '<h2><span style="color:rgb(51, 0, 255)">Can you supply a service?</span></h2>\r\n\r\n<p><span style="font-size:12px">Just follow the same&nbsp;free, friendly and&nbsp;fast&nbsp;service selection&nbsp;steps (what-where-when).&nbsp;The<span style="font-family:arial,helvetica,sans-serif"><strong> </strong>uinteam platform will&nbsp;find for you&nbsp;any&nbsp;Asker&#39;s request matching your requirements. When you accept the request, you might win the competition through the uinteam automatic selection process, and be procured as the best supplier&nbsp;to start delivering your service. The selection process&nbsp; is based on the following objective factors:</span></span></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px"><strong>experience -&nbsp;qualifications - feedback</strong></span></p>\r\n\r\n<p><span style="font-size:12px">uinteam will never ask you for any fee.</span></p>\r\n\r\n<p><span style="font-size:12px">Registrations are now open to build the strongest Supplier team and start to analyze the pattern of demand for&nbsp;all services.</span></p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2><span style="color:rgb(51, 0, 255)">Can you advise Askers?</span></h2>\r\n\r\n<p><span style="font-size:12px">If you like, you can also&nbsp;be an&nbsp;<span style="font-size:16px"><strong>Adviser</strong></span>&nbsp;to assist&nbsp;askers&nbsp;on any deal relevant to your&nbsp;expertise.</span></p>\r\n\r\n<p><span style="font-size:12px">When advised deals are successful, Advisers will&nbsp;be&nbsp;rewarded by uinteam&nbsp; with a percentage of the deal&#39;s transaction .</span></p>\r\n'),
(3, 'about_main', '<h2><span style="font-size:16px"><span style="color:rgb(51, 0, 255)"><strong><span style="font-size:20px">Y</span>OU ARE&nbsp;IN THE TEAM</strong></span></span></h2>\r\n\r\n<p>Welcome! uin team is&nbsp;a new generation marketplace <strong>completely free </strong>with the objective to assist users and <strong>dynamically</strong> provide a more sustainable economy through a <strong>global</strong> and <strong>crowdsourced</strong>&nbsp;platform for a more agile and effective procurement of services</p>\r\n\r\n<p>The idea has been driven by the strong commitment of the founder on academic research, professional experience and social responsibility for a resulting marketplace to be customised by the users themselves and open to continuous improvements.</p>\r\n'),
(12, 'feedback_btn', '<p>uin help</p>\r\n'),
(14, 'feedback_text', '<p><strong><span style="color:rgb(0, 51, 255)">Dear user, welcome to&nbsp;uin team.</span></strong></p>\r\n\r\n<p><strong><span style="color:rgb(0, 51, 255)">Here is the opportunity to provide any feedback on this&nbsp;website, while working towards the launch soon.</span></strong></p>\r\n\r\n<p><strong><span style="color:rgb(0, 51, 255)">Many thanks</span></strong></p>\r\n'),
(15, 'motto', '<p style="text-align:center"><span style="font-family:arial,helvetica,sans-serif">With you asking for&nbsp;and supplying services worldwide</span></p>\r\n\r\n<p style="text-align:center">....<a href="http://uinteam.com/about/"><strong>you are in the team!</strong></a></p>\r\n'),
(16, 'adviseBox_label_budget', '<p>Need advice on the appropriate budget?</p>\r\n'),
(17, 'adviseBox_label_msg', '<p>Need additional help? Leave a message:</p>'),
(18, 'terms', '<h1><strong>UINTEAM.COM</strong></h1>\r\n\r\n<h1><strong>TERMS AND CONDITIONS</strong></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PRELIMINARY </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>By using this site for any purpose including offering or buying services, seeking services, offering advice , or uploading comment and other content or generally entering into any transaction you are deemed to have agreed to these Terms and Conditions. We reserve the right to modify them at any time without notice other than at this page. By using this site you agree to accept changes without notice.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The function and purpose of this site is to facilitate the introduction of people seeking services to those offering services by identifying a supplier of the requested service that satisfies various criteria including, amongst other things, location and time for delivery.&nbsp; The site also enables certain users to offer advice and guidance on price and/or details to those seeking services.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>DEFINITIONS</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&#39;Adviser(s)&#39; refers to any person(s) or body who offers to provide advice to Asker(s) through the Site;</p>\r\n\r\n<p>&#39;ADR&#39; refers to Alternative Dispute Resolution meaning a process to resolve disputes outside of the courts;</p>\r\n\r\n<p>&#39;Approved ADR Service&#39; refers to an ADR provider that has been approved under the provisions of the Alternative Dispute Resolution for Consumer Disputes (Competent Authorities and Information) Regulations 2015 by the Chartered Institute of Trading Standards and listed on the European Commission website at https://webgate.ec.europa.eu/odr/main/index.cfm?event=main.adr.show ;</p>\r\n\r\n<p>&#39;Asker(s)&#39; refers to any person(s) or body who buys or seeks to buy services from Supplier(s) through the Site;</p>\r\n\r\n<p>&#39;Consumer(s)&#39; refers to any person who, when buying any services, for any purposes, including&nbsp;his or her trade, profession, business or craft;</p>\r\n\r\n<p>&#39;Forum&#39; means any message board, chat room, consumer review area or similar appearing on any part of the Site.</p>\r\n\r\n<p>&#39;Process&#39; refers to the process followed by uinteam when operating the service available on the Site as may be amended from time to time in its absolute discretion and available by hyperlink from within the footer of each page on the Site;</p>\r\n\r\n<p>&#39;Services&#39; includes the provision of any form of service sought by Askers and offered by Suppliers and includes the provision of goods required to enable the service to be provided to an Asker as well as the provision of advice by an Adviser to an Asker;</p>\r\n\r\n<p>&lsquo;Site&rsquo; or &lsquo;Sites&rsquo; refers to the website accessible at the address www.uinteam.com together with all other websites, web pages, web content and files of any nature&nbsp; owned , registered to and /or managed by uinteam and accessible by navigation at, or from, that address;</p>\r\n\r\n<p>&#39;Supplier(s)&#39; refers to any person(s) or body who offers any services through the Site.</p>\r\n\r\n<p>&lsquo;Uinteam&rsquo; refers to Uin Limited a company registered in England and Wales under registration number 08587439 and is situated at The Perspective 97, 100 Westminster Bridge Road, London, SE1 7XB as well as any subsidiary, connected or holding company(ies) or partner(s) or affiliate company(ies) or licensee(s) as well as all employees, contractors or consultants employed by or contracted to Uin Limited for purposes connected with the operation of the Site;</p>\r\n\r\n<p>&#39;User(s)&#39; refers to any and all persons and bodies who visit the Site whether or not to buy or sell services or provide advice to Askers, but including those who also come within the definition of Supplier, Asker or Adviser.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ALL USERS AGREE AS FOLLOWS:-</strong></p>\r\n\r\n<ol start="1">\r\n	<li>\r\n	<p>Uinteam acts only as an introducer between Askers, Suppliers and Advisers, as well as a channel for payment of services provided by Suppliers and Advisers, and does not become a party to any transaction for the provision of services entered into between Asker and Supplier enabled through the facilities on the Site or otherwise.Uinteam is neither an agent nor representative of any Supplier or Adviser.</p>\r\n	</li>\r\n	<li>\r\n	<p>Uinteam is not responsible for any error with services ordered or supplied or for the extent of services provided, their quality, fitness for purpose, compliance with the description or otherwise.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Any liability in law of a Supplier to refund monies paid or pay damages or to undertake any action rests solely with the Supplier.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Uinteam may change any content or functionality of the Site or restrict access to parts or all of the Site without notice at any time and without incurring any liability to you.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>The contents of this site are the intellectual property of Uinteam or some part of them or other persons who have licensed their use to others. Users may access the materials located within the Uinteam sites only for their own use and for the purpose of the Site in connecting Askers with Suppliers and Advisers and for no other purpose whatsoever.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Users may not copy, publish, display, modify, transmit or in any way interfere with the content of this site. Users may not download or cause to be downloaded or otherwise retain, or cause the retention of by others, any content on this Site.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>On the occurrence of any breach by a User, or on a User&#39;s behalf, of any of these Terms, Uinteam reserves the right, and without incurring any liability to such User of any nature, to forthwith remove the User from the Site without notice and bar the User from using any account set up on the Site or otherwise bar the User from making use of the service available on the Site. In such an event all monies due from the User to Uinteam will be due immediately and the User will forfeit any refunds otherwise due.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Users will not engage in any form of unsolicited contact with other Users for purposes other than that for which the Site was set up.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Uinteam reserves the right to refuse to display, or retain for display, any content, text or graphics, uploaded by Users, or on a User&#39;s behalf, to the Site which it considers in its absolute discretion to be obscene, pornographic, racist, abusive, threatening, offensive or otherwise inappropriate or otherwise breaches any law applicable to the Site or to Uinteam or these Terms and Conditions or the Process or generally the spirit of the service offered on the Site.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Users undertake to ensure that all information they provide to Uinteam and/or is uploaded to the Site, including any comment or observation on the standard and quality of any service provided by a Supplier, is truthful and any comment or opinion is also genuine, honest, reasonable and does not breach or infringe the rights of any other person.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Not to post on the Site any material that is untruthful, obscene, abusive, threatening, harassing, defamatory or otherwise breaches any law as to content and not to post or transmit any material that contains a virus or other harmful component.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>At all times when accessing the Site, and, whether, whilst on or off the Site, acting in connection with the seeking or delivering of any services of Suppliers, that all Users will comply fully with the rules and procedures set out in the Process, as amended from time to time in the absolute discretion of Uinteam.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Uinteam does not monitor material posted by users. Should you be concerned with any content you can notify us by email to info@uinteam.com.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Uinteam has the right at any time and without notice to modify or remove material that, in their sole discretion, they consider infringes these Terms and, if uinteam modifies such material they have no liability for the effect of such modification or removal.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>By posting messages or otherwise uploading content onto the uinteam Sites, Users warrant that they own all of the rights to the content posted, or have the full permission of the owner of such rights to so use, and that the publication and use of such content by uinteam will not infringe the rights of any third party. Users also grant without compensation (or warrant that the owner of such rights has expressly so granted and fully indemnify uinteam against all claims and demands from such owner in respect of such messages and content should such not be the case) Uinteam, and others licensed by uinteam to exercise such rights, the worldwide, perpetual, non-exclusive right to use such messages and content, in their original or edited form on any media whatsoever whether or not such currently exists as a medium.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>All Users will fully indemnify and keep indemnified uinteam against all losses, damages, claims and demands of any nature whatsoever by any person or body in respect of any action taken or failed to betaken in respect of their use of the Site.</p>\r\n	</li>\r\n	<li>\r\n	<p>Uinteam is not responsible, and has no liability, for the availability of, and content and functionality on, any other site to which any of the uinteam Sites links.</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p><strong>SUPPLIERS AND ADVISERS AGREE AS FOLLOWS:-</strong></p>\r\n	</li>\r\n	<li>\r\n	<p>No services or advice may be offered for sale or sold on this Site save by those who have, beforehand , applied to be registered bycompleting the Registration Form at <a href="http://uinteam.com/registration/">http://uinteam.com/registration/</a> as Suppliers or, in the case of the provision of advice,Advisers, on the Site, and, beforehand, receiving a notice of confirmation of acceptancefrom uinteam.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Uinteam reserve the absolute right at all times to refuse to register an applicant to be a Supplier, Asker or Adviser and, in such case, all applicants to be registered agree, as a condition of their application, that uinteam will have no liability whatsoever fortheir refusal to register such an applicant.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Uinteam reserve the absolute right at all times and without notice to terminate registration of a Supplier or Adviser or Asker without any reason being given or required and, in such circumstances, the Supplier or Adviser or Asker, as the case may be, agrees that they have no recourse in law whatsoever against Uinteam for such termination and its consequences.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Suppliers or Advisers warrant to uinteam that no services shall be offered for sale on the Site unless they match the description given, perform as described and, generally, fully satisfy all obligations and duties in lawthat apply to the sale and provision of such services and according as to whether or not the Asker is a Consumer.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Suppliers and Advisers will not offer for sale any services on the Site save on the basis that any sale of any such services is transacted in such a way as to be regulated by a set of your ownTerms and Conditions access to which you provide to all Askers prior to an order being accepted and which comply with The Consumer Contracts (Information, Cancellation and Additional Charges) Regulations 2013 , the Consumer Rights Act 2015 and other statutes and regulations relating to the sale of services and do not conflict in any way with any element of these Terms and Conditions of Uinteam.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Suppliers and Advisers warrant to Uinteam that they will at all times comply fully with the provisions of The Consumer Contracts (Information, Cancellation and Additional Charges) Regulations 2013 , the Consumer Rights Act 2015 and other statutes and regulations relating to the sale of services and to all contracts you enter into with Askers through the Site.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Suppliers and Advisers warrant to uinteam that either they own all Intellectual Property Rights in all images, logos, icons, trademarks, text and other forms of content that they upload onto the Site, whether to describe any of the services or otherwise, or have full licence and permission to do so from the owner of such Intellectual Property Rightsand, further, fully indemnify and keep indemnified uinteam against all losses, damages, claims made or sufferedas a result of any claim or allegation by any person or body of breach of their Intellectual Property Rights.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Uinteam has no liability in law whatsoever for any damage, loss or claim sustained by you as a result, directly or indirectly, of actions of any other User of the Site whether for failure to make a payment, failure to deliver a service to the standard expected of the Asker, the posting of any review or comment, whether on the Site or another website or on social media, or for any reason whatsoever.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>They will not post or upload, on any website (including the Site), social media, Forum, blog or anywhere on the World Wide Web or on any print media, comment or content, whether text images, video, audio or whatever generally, that is critical of uinteam its directors, employees or contractors and shall fully indemnify and keep indemnified uinteam, its directors, employees or contractors againstall losses, damages or claims that may result from failure to honour this provision and, further, shall, on request by uinteam, withdraw any such content form being publicly accessible.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>As is set out in detail in the Process (as amended from time to time), uinteam will receive all payments from Askers for services bought on or through the Site and that uinteam will charge the Supplier a fee representing a percentage of the whole payment made by the Asker and also chargeto the Asker for any advice given by an Adviser. Uinteam may take payment of such fees charged to the Suppliers by deduction from monies received by uinteam from the Askers and facilitate payment to the Adviser for any advice given as well as account to the Supplier at the times, and in the manner, set out in the Process.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Not to offer and/or provide services to Users save only through the Site and in accordance with the Process.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Uinteam has no liability for any return of monies to a Customer as may from time to time be required or actioned by any credit or debit card company or similar in accordance with its Chargeback Policy, or by any payment processor or marketplace whose services are incorporated into the sales process of a Supplier or Adviser.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Suppliers and Advisers may cancel their registration from the Site on 7 days written notice by completion of the online form available at http://uinteam.com/terms/. Notwithstanding cancellation they remain subject to any relevant continuing liability under these Terms and Conditions.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>In accordance with the obligations on Suppliers and Advisers under Regulation 19 of the Alternative Dispute Resolution for Consumer Disputes (Competent Authorities and Information) Regulations 2015, Suppliers and Advisers will notify any Consumer buying through the Site and with whom they are in dispute concerning a transaction, and which dispute has not been resolved, of the name of the Approved ADR Service called Net Neutrals EU and of their website address at <a href="http://www.netneutrals.uk/">http://www.netneutrals.uk</a> &nbsp;stating to such Consumer that they will participate fully in any ADR procedure&nbsp; offered by such Approved ADR Service and comply with the outcome whether agreed under mediation or determined under adjudication and, further,&nbsp; that they authorise Uinteam to so notify all Customers of that same information in any form and at anytime including by general notice on the Site.&nbsp;</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>In accordance with their obligations under Article 14 of the Regulation of the European Parliament on Online Dispute Resolutionfor Consumer Disputes (EU 524/2013) Suppliers and Advisers agree that at all times any website they operate will contain a hyperlink to the European Commission&#39;s website &nbsp;at https://webgate.ec.europa.eu/odr/main/?event=main.home.show</p>\r\n	</li>\r\n</ol>\r\n\r\n<p style="margin-left: 32.2pt;">&nbsp;</p>\r\n\r\n<ol start="33">\r\n	<li>\r\n	<p>In accordance with the obligations to Consumers under the Consumer Rights Act 2015, Suppliers and Advisers agree to notify each and every Consumer, and uinteam, of the businessaddress and email address to which Consumers may send notices of cancellation as set out in Paragraphs 38-44 below and, further, authorise uinteam to provide such informationto Consumers both directly and on the Site.Further, Suppliers and Advisers undertake to repay, or authorise Uinteam to repay out of monies that may then be held for them, what they may be due under the Consumer Rights Act 2015 or otherwise.</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p><strong>ASKERS AGREE AS FOLLOWS:-</strong></p>\r\n	</li>\r\n	<li>\r\n	<p>That all services described on the Site by Suppliers are done so as an invitation to receive an order to purchase and any procedure followed on the Site with a view to buying any services, including payment, amounts to an offer to purchase and does not create any contractual relationship between the Asker and the Supplier or any obligation on the part of the Supplier until such time as the Suppliers have satisfied themselves that they are able and willing to deliver the services at the described price, required location and within the required timeframe.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>If in dispute with a Supplier over services purchased on the Site, which is not resolved by the Supplier, Askers note that the Supplier has agreed within these Terms and Conditions to refer you to an Approved ADR Service called Net Neutrals EU and to their website address at http://www.netneutrals.uk</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Notwithstanding, and without prejudice to the fact that the Supplier may have applied Terms and Conditions to the purchase of a service that gives the Asker improved right in this regards, if an Asker purchases services on the Site as a Consumer, and not otherwise, then the Asker has a legal right to cancel the contract to purchase during the period set out in Paragraph 38 below. This means that a payment has been escowed, if the Asker changes his or her mind or for any other reason decides not to continue to receive the service, the Asker can notify the Supplier through the message tool in My uinteam of the decision to cancel the service delivery and be entitled thereupon to receive a refund from uinteam. Advice about the legal right to cancel the contract is available from a local Citizens&#39; Advice Bureau or Trading Standards office.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>37. This cancellation right does not apply in the case of:-</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>* Any product or service for which the price is dependent on fluctuations in the financial market which is outside the control of the Supplier;</p>\r\n\r\n<p>* Any made-to-measure or custom-made products or products made to your specification or clearly personalised;</p>\r\n\r\n<p>* Services that include the provision of perishable goods liable to deteriorate or expire, such as food, drink or fresh flowers;</p>\r\n\r\n<p>* Services that include the provision of alcoholic beverages where the price has been agreed at the time of the or acceptance of your Order, delivery can only take place after 30 days and their value is dependent on fluctuations in the market which cannot be controlled by ourselves;</p>\r\n\r\n<p>* Services that include the provision of software, DVDs or CDs which have a security seal which you have opened or unsealed.</p>\r\n\r\n<p>* Services that include the provision of accommodation, transport of goods, vehicle rental services, catering or services related to leisure activities, if the contract provides for a specific date or period of performance.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>CANCELLATION</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start="38">\r\n	<li>\r\n	<p>In the case of services that include the supply of digital content which is not supplied on a tangible medium, the Asker has the right to cancel this contract within 14 days from the day of the Supplier&#39;s acceptance of the order so long as the service has not begun to be provided;</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start="39">\r\n	<li>\r\n	<p>To exercise the right to cancel, the Asker must inform the Supplier of the decision to cancel this contract by a clear statement through the messaging tool in My uinteam or by completion of the Cancellation Form set out in the Schedule below.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start="40">\r\n	<li>\r\n	<p>Uinteam will make the reimbursement without undue delay, and not later than14 days after the day that the Asker provides evidence that he has cancelled the delivery of the service.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start="41">\r\n	<li>\r\n	<p>If the Asker requested to begin the performance of services during the cancellation period, he or she shall pay to the Supplier an amount which is in proportion to what has been performed until he or she communicated to them the wish to cancel, in comparison with the full scope of the service as initially agreed to be purchased.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ACKNOWLEDGEMENTS AND WARRANTIES</strong></p>\r\n\r\n<ol start="42">\r\n	<li>\r\n	<p>All Users warrants that they have legal capacity to enter into the agreement set out in these Terms.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>All Users acknowledge that uinteamdoes not check for the truthofinformation entered on it by other persons when using the services whether as describing themselves, any services or advicethey offer or otherwise. Uinteam does not warrant the accuracy of any content on the Site nor is liable for any action or inaction taken as a result of reliance on any such content.</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p><strong>LIMITATIONS </strong></p>\r\n	</li>\r\n	<li>\r\n	<p>Whilst uinteamtakes reasonable precautionsto this extent, uinteamdoes not guarantee, given the nature of the Internet,that the Site will always be fully operational or virus, bug or error free and does not, therefore, have any responsibility for any defects that may exist or for any consequences, costs or losses arising from your use of, or inability to access, the Site.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Save in respect of death or personal injury arising from our negligence, Uinteamhas no liability for any claims, losses, demands or damages or such like arising directly or indirectly out of, or in any way connected with, the use of the Site or the inability of any User for any reason to access the Site.Notice to uinteam of the potential for such damage does not limit such exclusion from liability.</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p><strong>INDEMNITIES&nbsp; </strong></p>\r\n	</li>\r\n	<li>\r\n	<p>All Users agree that they will at all times indemnify and keep indemnified uinteamand its officers, directors, employees, contractors, agents, partners, distributors and affiliates from and against any and all claims, losses, damage or liability (whether criminal or civil) suffered and fees and costs incurred, including reasonable legal fees, resulting from any act of neglect or default or breach by them or by any person who they may have authorised or for whom they have responsibility of any of these Terms and/or from any and all use of the Site and services on it and in particular, if a Supplier or Adviser, for any breach of The Consumer Contracts (Information, Cancellation and Additional Charges) Regulations 2013 and other statutes and regulations.</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p><strong>LIMITATION OF LIABILITY</strong></p>\r\n	</li>\r\n	<li>\r\n	<p>Neither uinteam nor any of its affiliated companies or any of its or their respective licensors or suppliers will, in any circumstances, be liable for any special or consequential damages that may result from the use of, or the inability to use, the uinteam Sites or any products or services provided thereon.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>The total liability to any User of uinteam or any of its affiliated companies or any of its or their respective licensors or suppliers, for all damages, losses, and causes of action (whether in contract, tort, or otherwise) shall not exceed the amount paid by any User to uinteam , if any, for use of and access to the Site .and for the benefit to you of the Process.</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p><strong>JURISDICTION</strong></p>\r\n	</li>\r\n	<li>\r\n	<p>These Terms shall be governed by and construed in accordance with the laws of England and Wales and the courts of England and Wales shall have exclusive jurisdiction over any resolution through a court system of disputes arising out of this Site and its use.</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p><strong>DISPUTE RESOLUTION</strong></p>\r\n	</li>\r\n	<li>\r\n	<p>If any dispute or difference arises out of or in connection with these Terms the parties shall, in the first instance, refer the matter to www.themediationroom.com for the purpose of that website offering a form of mediation or other form of alternative dispute resolution (ADR) procedure acceptable to both parties before pursuing any other remedies available to them.</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p><strong>MISCELLANEOUS</strong></p>\r\n	</li>\r\n	<li>\r\n	<p>If any section or part of a section of these Terms shall be unlawful, void, or for any reason unenforceable, then that section or part ofa section shall be deemed severable and shall not affect the validity and enforceability of the remainder of these Terms.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>These Terms contain the entire agreement between Users and Uinteam relating to the matters contained herein.</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p><strong>CANCELLATION FORM</strong></p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p>To:</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p>I give you notice that I cancel our contract for the sale of the following services:-</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p>Ordered on:</p>\r\n\r\n	<p>Name of consumer;</p>\r\n\r\n	<p>Address of consumer;</p>\r\n\r\n	<p>Signature of consumer (if submitted on paper)</p>\r\n\r\n	<p>Date:</p>\r\n	</li>\r\n</ol>\r\n'),
(19, 'privacy', '<p><strong>PRIVACY POLICY</strong></p>\r\n\r\n<p style="text-align:justify">Uinteam (&quot;We&quot;) are committed to protecting and respecting your privacy.</p>\r\n\r\n<p style="text-align:justify">This policy (together with our terms of use, which you can find at http://uinteam.com/terms/, and any other documents referred to on it) sets out the basis on which any personal data we collect from you, or that you provide to us, will be processed by us.&nbsp; Please read the following carefully to understand our views and practices regarding your personal data and how we will treat it. By visiting http://uinteam.com/ you are accepting and consenting to the practices described in this policy.</p>\r\n\r\n<p style="text-align:justify">For the purpose of the Data Protection Act 1998 (the Act), the data controller is UIN Ltd with&nbsp;offices at&nbsp;97 The Perspective, 100 Westminster Bridge Road, London.</p>\r\n\r\n<p style="text-align:justify">Our nominated representative for the purpose of the Act is Mr. Salvatore Zappal&agrave;.</p>\r\n\r\n<p style="text-align:justify"><strong>Information we may collect from you.</strong></p>\r\n\r\n<p style="text-align:justify">We may collect and process the following data about you:</p>\r\n\r\n<ul>\r\n	<li style="text-align:justify"><strong>Information you give us.</strong> You may give us information about you by filling in forms on our site http://uinteam.com/ (our site) or by corresponding with us by phone, e-mail or otherwise. This includes information you provide when you register to use our site, subscribe to our service, place an order on our site, participate in discussion boards or other social media functions on our site, enter a competition, promotion or survey, and when you report a problem with our site. The information you give us may include your name, address, e-mail address and phone number, financial and credit card information.</li>\r\n	<li style="text-align:justify"><strong>Information we collect about you.</strong> With regard to each of your visits to our site we may automatically collect the following information:\r\n	<ul>\r\n		<li style="text-align:justify">technical information, including the Internet protocol (IP) address used to connect your computer to the Internet, your login information, browser type and version, time zone setting, browser plug-in types and versions, operating system and platform;</li>\r\n		<li style="text-align:justify">information about your visit, including the full Uniform Resource Locators (URL) clickstream to, through and from our site (including date and time); products you viewed or searched for; page response times, download errors, length of visits to certain pages, page interaction information (such as scrolling, clicks, and mouse-overs), and methods used to browse away from the page and any phone number used to call our customer service number.</li>\r\n	</ul>\r\n	</li>\r\n	<li style="text-align:justify"><strong>Information we receive from other sources.</strong> We may receive information about you if you use any of the other websites we operate or the other services we provide. In this case we will have informed you when we collected that data that it may be shared internally and combined with data collected on this site. We are also working closely with third parties (including, for example, business partners, sub-contractors in technical, payment and delivery services, advertising networks, analytics providers, search information providers, credit reference agencies) and may receive information about you from them.</li>\r\n</ul>\r\n\r\n<p style="text-align:justify"><strong>Cookies</strong></p>\r\n\r\n<p style="text-align:justify">Our website uses cookies to distinguish you from other users of our website. This helps us to provide you with a good experience when you browse our website and also allows us to improve our site. For detailed information on the cookies we use and the purposes for which we use them see our Cookie Policy below.</p>\r\n\r\n<p style="text-align:justify"><strong>Uses made of the information</strong></p>\r\n\r\n<p style="text-align:justify">We use information held about you in the following ways:</p>\r\n\r\n<ul>\r\n	<li style="text-align:justify"><strong>Information you give to us.</strong> We will use this information:\r\n\r\n	<ul>\r\n		<li style="text-align:justify">to provide you with information about other goods and services we offer that are similar to those that you have already purchased or enquired about;</li>\r\n		<li style="text-align:justify">to carry out our obligations arising from any contracts entered into between you and us and to provide you with the information, products and services that you request from us;</li>\r\n		<li style="text-align:justify">to provide you, or permit selected third parties to provide you, with information about goods or services we feel may interest you. If you are an existing customer, we will only contact you by electronic means (e-mail or SMS) with information about goods and services similar to those which were the subject of a previous sale or negotiations of a sale to you. If you are a new customer, and where we permit selected third parties to use your data, we (or they) will contact you by electronic means only if you have consented to this.</li>\r\n		<li style="text-align:justify">to notify you about changes to our service;</li>\r\n		<li style="text-align:justify">to ensure that content from our site is presented in the most effective manner for you and for your computer.</li>\r\n	</ul>\r\n	</li>\r\n	<li style="text-align:justify"><strong>Information we collect about you.</strong> We will use this information:\r\n	<ul>\r\n		<li style="text-align:justify">to administer our site and for internal operations, including troubleshooting, data analysis, testing, research, statistical and survey purposes;</li>\r\n		<li style="text-align:justify">to improve our site to ensure that content is presented in the most effective manner for you and for your computer;</li>\r\n		<li style="text-align:justify">to allow you to participate in interactive features of our service, when you choose to do so;</li>\r\n		<li style="text-align:justify">as part of our efforts to keep our site safe and secure;</li>\r\n		<li style="text-align:justify">to measure or understand the effectiveness of advertising we serve to you and others, and to deliver relevant advertising to you;</li>\r\n		<li style="text-align:justify">to make suggestions and recommendations to you and other users of our site about goods or services that may interest you or them.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li style="text-align:justify"><strong>Information we receive from other sources. </strong>We may combine this information with information you give to us and information we collect about you. We may use this information and the combined information for the purposes set out above (depending on the types of information we receive).</li>\r\n</ul>\r\n\r\n<p style="text-align:justify"><strong>Disclosure of your information</strong></p>\r\n\r\n<p style="text-align:justify">We may share your information with selected third parties including:</p>\r\n\r\n<ul>\r\n	<li style="text-align:justify">Business partners, suppliers and sub-contractors for the performance of any contract we enter into with them or you.</li>\r\n	<li style="text-align:justify">Advertisers and advertising networks that require the data to select and serve relevant adverts to you and others.&nbsp; We do not disclose information about identifiable individuals to our advertisers, but we may provide them with aggregate information about our users (for example, we may inform them that 500 men aged under 30 have clicked on their advertisement on any given day). We may also use such aggregate information to help advertisers reach the kind of audience they want to target (for example, women in SW1). We may make use of the personal data we have collected from you to enable us to comply with our advertisers&#39; wishes by displaying their advertisement to that target audience.</li>\r\n	<li style="text-align:justify">Analytics and search engine providers that assist us in the improvement and optimisation of our site.</li>\r\n	<li style="text-align:justify">Credit reference agencies for the purpose of assessing your credit score where this is a condition of us entering into a contract with you.</li>\r\n</ul>\r\n\r\n<p style="text-align:justify">We may disclose your personal information to third parties:</p>\r\n\r\n<ul>\r\n	<li style="text-align:justify">In the event that we sell or buy any business or assets, in which case we may disclose your personal data to the prospective seller or buyer of such business or assets.</li>\r\n	<li style="text-align:justify">If Uin Limited or substantially all of its assets are acquired by a third party, in which case personal data held by it about its customers will be one of the transferred assets.</li>\r\n	<li style="text-align:justify">If we are under a duty to disclose or share your personal data in order to comply with any legal obligation, or in order to enforce or apply our terms of use http://uinteam.com/terms/ and other agreements; or to protect the rights, property, or safety of Uin Limited, our customers, or others. This includes exchanging information with other companies and organisations for the purposes of fraud protection and credit risk reduction.</li>\r\n</ul>\r\n\r\n<p style="text-align:justify"><strong>Where we store your personal data</strong></p>\r\n\r\n<p style="text-align:justify">The data that we collect from you may be transferred to, and stored at, a destination outside the European Economic Area (&quot;EEA&quot;). It may also be processed by staff operating outside the EEA who work for us or for one of our suppliers. Such staff maybe engaged in, among other things, the fulfilment of your order, the processing of your payment details and the provision of support services. By submitting your personal data, you agree to this transfer, storing or processing. We will take all steps reasonably necessary to ensure that your data is treated securely and in accordance with this privacy policy.</p>\r\n\r\n<p style="text-align:justify">All information you provide to us is stored on our secure servers. &nbsp;Any payment transactions will be encrypted in accordance with&nbsp;PayPal encrypting technology.&nbsp; Where we have given you (or where you have chosen) a password which enables you to access certain parts of our site, you are responsible for keeping this password confidential. We ask you not to share a password with anyone.</p>\r\n\r\n<p style="text-align:justify">Unfortunately, the transmission of information via the internet is not completely secure. Although we will do our best to protect your personal data, we cannot guarantee the security of your data transmitted to our site; any transmission is at your own risk. Once we have received your information, we will use strict procedures and security features to try to prevent unauthorised access.</p>\r\n\r\n<p style="text-align:justify"><strong>Your rights</strong></p>\r\n\r\n<p style="text-align:justify">You have the right to ask us not to process your personal data for marketing purposes. We will usually inform you (before collecting your data) if we intend to use your data for such purposes or if we intend to disclose your information to any third party for such purposes. You can exercise your right to prevent such processing by checking certain boxes on the forms we use to collect your data.&nbsp; You can also exercise the right at any time by contacting us at info@uinteam.com.</p>\r\n\r\n<p style="text-align:justify">Our site may, from time to time, contain links to and from the websites of our partner networks, advertisers and affiliates.&nbsp; If you follow a link to any of these websites, please note that these websites have their own privacy policies and that we do not accept any responsibility or liability for these policies.&nbsp; Please check these policies before you submit any personal data to these websites.</p>\r\n\r\n<p style="text-align:justify"><strong>Access to information</strong></p>\r\n\r\n<p style="text-align:justify">The Act gives you the right to access information held about you. Your right of access can be exercised in accordance with the Act. Any access request may be subject to a fee of &pound;10 to meet our costs in providing you with details of the information we hold about you.</p>\r\n\r\n<p style="text-align:justify">Changes to our privacy policy</p>\r\n\r\n<p style="text-align:justify">Any changes we may make to our privacy policy in the future will be posted on this page and, where appropriate, notified to you by e-mail. Please check back frequently to see any updates or changes to our privacy policy.</p>\r\n\r\n<p style="text-align:justify"><strong>Contact</strong></p>\r\n\r\n<p style="text-align:justify">Questions, comments and requests regarding this privacy policy are welcomed and should be addressed to info@uinteam.com.</p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n\r\n<p style="text-align:justify"><strong>COOKIE POLICY</strong></p>\r\n\r\n<p style="text-align:justify"><strong>Information about our use of cookies</strong></p>\r\n\r\n<p style="text-align:justify">Our website uses cookies to distinguish you from other users of our website. This helps us to provide you with a good experience when you browse our website and also allows us to improve our site. By continuing to browse the site, you are agreeing to our use of cookies.</p>\r\n\r\n<p style="text-align:justify">A cookie is a small file of letters and numbers that we store on your browser or the hard drive of your computer if you agree. Cookies contain information that is transferred to your computer&#39;s hard drive.</p>\r\n\r\n<p style="text-align:justify">We use the following cookies:</p>\r\n\r\n<ul>\r\n	<li style="text-align:justify"><strong>Functionality cookies.</strong> These are used to recognise you when you return to our website. This enables us to personalise our content for you, greet you by name and remember your preferences (for example, your choice of language or region).</li>\r\n</ul>\r\n\r\n<p style="text-align:justify">You can find more information about the individual cookies we use and the purposes for which we use them in the table below:</p>\r\n\r\n<table border="0" cellpadding="0" cellspacing="0">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width:139px">\r\n			<p><strong>Cookie</strong></p>\r\n			</td>\r\n			<td style="width:139px">\r\n			<p><strong>Name</strong></p>\r\n			</td>\r\n			<td style="width:139px">\r\n			<p><strong>Purpose</strong></p>\r\n			</td>\r\n			<td style="width:140px">\r\n			<p><strong>More information</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:139px">\r\n			<p>Remember me</p>\r\n			</td>\r\n			<td style="width:139px">\r\n			<p>remember_me</p>\r\n			</td>\r\n			<td style="width:139px">\r\n			<ul>\r\n				<li>Recognise you when you return to our site.</li>\r\n			</ul>\r\n			</td>\r\n			<td style="width:140px">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style="text-align:justify">Please note that third parties (including, for example, advertising networks and providers of external services like web traffic analysis services) may also use cookies, over which we have no control. These cookies are likely to be analytical/performance cookies or targeting cookies.</p>\r\n\r\n<p style="text-align:justify">You block cookies by activating the setting on your browser that allows you to refuse the setting of all or some cookies. However, if you use your browser settings to block all cookies (including essential cookies) you may not be able to access all or parts of our site.</p>\r\n\r\n<p style="text-align:justify">Except for essential cookies, all cookies will expire after 52 weeks.</p>\r\n\r\n<p style="text-align:justify">Questions, comments and requests regarding this cookie policy are welcomed and should be addressed to info@uinteam.com.</p>\r\n'),
